import "./AddEmployee.css";
import { useState } from "react";
import { addEmployee } from "./api";

const [name, setname] = useState("");
const [gender, setgender] = useState("");
const [department, setdep] = useState("");
const [designation, setdesignation] = useState("");
const [DOB, setDOB] = useState(new Date());
const [DOJ, setDOJ] = useState(new Date());
const [empID, setID] = useState("");
const AddEmployee = () => {
  const [name, setName] = useState("");
  const [gender, setGender] = useState("");
  const [birthdate, setbirthdate] = useState("");
  const [joiningdate, setjoiningdate] = useState("");
  const [email, setEmail] = useState("");
  const [doj, setDoj] = useState("");
  const [mobile, setMobile] = useState("");

  const onNameChange = (e) => {
    setName(e.target.value);
  };
  const onGenderChange = (e) => {
    setGender(e.target.value);
  };
  const onbirthdateChange = (e) => {
    setbirthdate(e.target.value);
  };
  const onjoiningdateChange = (e) => {
    setjoiningdate(e.target.value);
  };
  const onEmailChange = (e) => {
    setEmail(e.target.value);
  };
  const onDojChange = (e) => {
    setDoj(e.target.value);
  };
  function onMobileChange(e) {
    setMobile(e.target.value);
  }

  const handleAddEmployee = async (e) => {
    e.preventDefault();
    const employee = {
      name,
      gender,
      birthdate,
      joiningdate,
      email,
      doj,
      mobile
    };
    console.log("messbirthdate for employee",employee);
    await addEmployee(employee);
  };

  return (
    <div className="container">
      <h3 className="text-primary">Add Employee</h3>
      <form className="col-4" onSubmit={handleAddEmployee}>
        <div className="form-group">
          <label className="form-label">Name</label>
          <input type="text" className="form-control" onChange={onNameChange} />
        </div>
        <div className="form-group">
          <label className="form-label">Gender</label>
          &nbsp;&nbsp;
          <div className="form-check-inline">
            <input
              type="radio"
              className="form-check-input"
              name="gender"
              value="Male"
              onChange={onGenderChange}
            />
            <label className="form-check-label">Male</label>
          </div>
          &nbsp;&nbsp;
          <div className="form-check-inline">
            <input
              type="radio"
              className="form-check-input"
              name="gender"
              value="Female"
              onChange={onGenderChange}
            />
            <label className="form-check-label">Female</label>
          </div>
        </div>
        <div className="form-group">
          <label className="form-label">birthdate</label>
          <input type="text" className="form-control" onChange={onbirthdateChange} />
        </div>
        <div className="form-group">
          <label className="form-label">joiningdate</label>
          <input
            type="text"
            className="form-control"
            onChange={onjoiningdateChange}
          />
        </div>
        <div className="form-group">
          <label className="form-label">Email Id</label>
          <input
            type="email"
            className="form-control"
            onChange={onEmailChange}
          />
        </div>
        <div className="form-group">
          <label className="form-label">Date Of Joining</label>
          <input type="date" className="form-control" onChange={onDojChange} />
        </div>
        <div className="form-group">
          <label className="form-label">Mobile Number</label>
          <input
            type="text"
            className="form-control"
            onChange={onMobileChange}
          />
        </div>
        <br />
        <button className="btn btn-primary">Add Employee</button>
      </form>
    </div>
  );
};

export default AddEmployee;
